import{_ as e,c as r,a2 as t,o as i}from"./chunks/framework.YPpNXepj.js";const o="/assets/course_evaluation.BAG_9hTX.png",l="/assets/service_evaluation1.BTkkLHaW.webp",p="/assets/service_evaluation2.BFG-utgy.png",s="/assets/suggest.D2DWN3qT.png",g=JSON.parse('{"title":"前端金牌简历计划","description":"","frontmatter":{},"headers":[],"relativePath":"docs/services/1v1.md","filePath":"docs/services/1v1.md"}'),n={name:"docs/services/1v1.md"};function h(c,a,d,u,b,m){return i(),r("div",null,a[0]||(a[0]=[t('<h1 id="前端金牌简历计划" tabindex="-1">前端金牌简历计划 <a class="header-anchor" href="#前端金牌简历计划" aria-label="Permalink to &quot;前端金牌简历计划&quot;">​</a></h1><p>前端面试派 作者 <a href="https://juejin.cn/user/1714893868765373" target="_blank" rel="noreferrer">双越老师</a> 带领的 <strong>1v1 前端面试咨询服务</strong>，专业解决下面的问题：</p><ul><li>初入职场不知道如何写简历，如何写出内容和亮点</li><li>不知道如何准备面试题，搜出很多资料，但无从下手</li><li>工作几年，项目都是重复性的，写不出亮点和成绩</li><li>工作快 10 年了，但还是一线开发人员，如何体现个人经验？</li><li>业余不学习，基础知识很差，面试没信心</li><li>工作多年只会 Vue ，不懂算法，没有技术广度和深度</li><li>在一个公司呆久了，不知道该如何面试了</li><li>刚毕业，没实际项目经验</li><li>......</li></ul><h2 id="作者介绍" tabindex="-1">作者介绍 <a class="header-anchor" href="#作者介绍" aria-label="Permalink to &quot;作者介绍&quot;">​</a></h2><p>大家好我是<a href="https://juejin.cn/user/1714893868765373" target="_blank" rel="noreferrer">双越</a>，wangEditor 作者，前百度、滴滴资深前端工程师，PMP，慕课网金牌讲师，博客总流量 500w ，代表作品：</p><ul><li><a href="https://www.wangeditor.com/" target="_blank" rel="noreferrer">wangEditor</a> 开源 Web 富文本编辑器，GitHub Star 18k</li><li><a href="https://www.huashuiai.com/" target="_blank" rel="noreferrer">划水AI</a> Node 全栈 AIGC 知识库，AI 智能写作，多人协同编辑</li><li><a href="https://www.mianshipai.com/" target="_blank" rel="noreferrer">前端面试派</a> 系统专业的面试导航，大厂面试流程，开源免费</li></ul><p>我从 2017 年开始在慕课网讲授前端面试课程，是全网第一个做前端面试课程的讲师，至今已服务学员 5w+ 看过简历 2000+ 收到很多好评。而且，我此前一直是大厂面试官，非常清楚前端面试的流程和要求。</p><p><img src="'+o+'" alt=""></p><h2 id="缘起" tabindex="-1">缘起 <a class="header-anchor" href="#缘起" aria-label="Permalink to &quot;缘起&quot;">​</a></h2><p>2023 年 5 月开始，我推出了一个简单的 1v1 技术咨询服务，可以聊任何技术话题。陆续有很多人找我咨询，但绝大部分人都是为了优化简历，发掘亮点。</p><p>于是，我就改变了咨询方向，专门进行前端简历优化，帮助发掘个人、项目亮点。没想到效果非常好，他们给出了很好的评价，我也赚到了一些零花钱。</p><p><img src="'+l+'" alt=""></p><p>再后来咨询的人多了，我发现大家除了简历优化之外，还有很多其他面试相关的问题。于是我就根据个人的工作、授课、咨询的经验，制定了一个<strong>系统全面的面试准备解决方案</strong>。可以帮大家快速全面的准备面试。</p><p><img src="'+p+'" alt=""></p><p>再到 2025 年，我带领开发了 <a href="https://www.mianshipai.com/" target="_blank" rel="noreferrer">前端面试派</a> ，在这个网站的基础上，将该服务进行再一次升级为 <strong>金牌简历计划</strong>。</p><h2 id="金牌简历计划" tabindex="-1">金牌简历计划 <a class="header-anchor" href="#金牌简历计划" aria-label="Permalink to &quot;金牌简历计划&quot;">​</a></h2><p>不仅仅是优化简历，还会帮你扩展内容补全简历，从技能到项目。</p><p>不仅仅是发掘项目亮点，还会帮你摆正项目角色，提升技术视野。</p><p>不仅仅是两次 1v1 语音沟通，还有 3 个月的全流程跟踪、专属服务。</p><h2 id="服务内容" tabindex="-1">服务内容 <a class="header-anchor" href="#服务内容" aria-label="Permalink to &quot;服务内容&quot;">​</a></h2><h3 id="_1v1-前端简历优化" tabindex="-1">1v1 前端简历优化 <a class="header-anchor" href="#_1v1-前端简历优化" aria-label="Permalink to &quot;1v1 前端简历优化&quot;">​</a></h3><p>优化简历，发掘个人亮点和项目亮点。提高面邀率，增加面试机会，减少“已读不回”。</p><p>程序员的特点就是不会表达，做的出来，但简历上写不出来 —— 本服务就是来解决这个问题。</p><p>该服务会详细的、逐行的帮你分析简历，包括：专业技能，工作经历，项目经验。</p><p>特别是项目经验，会重点分析项目的功能和业务，帮你反掘项目亮点，帮你写出最好的表达方式。</p><p>有些同学已经工作 5 年以上，甚至 7 8 年了，还在以一个基层开发者的视角来描述项目，这肯定是不行的。此时需要你以一个项目前端负责人的视角来看待项目、描述项目，要多去考虑 <code>设计</code> <code>架构</code> <code>方案</code> 等这些方面。</p><p>还有，讲师会一边咨询，一边帮你记录和整理（全程不需要你动手，你只负责认真听），最后会发修改建议给你。</p><p><img src="'+s+'" alt=""></p><p>待你修改完以后，讲师还会再帮你 review 一次简历，看是否还有问题。</p><blockquote><p>我之前在 B 站分享了很多关于简历优化的<a href="https://www.bilibili.com/list/697803545/?sid=3349286&amp;oid=113976721539637&amp;bvid=BV1rwNReZEB1" target="_blank" rel="noreferrer">案例</a>，欢迎去参考～</p></blockquote><h3 id="_1v1-定制学习内容" tabindex="-1">1v1 定制学习内容 <a class="header-anchor" href="#_1v1-定制学习内容" aria-label="Permalink to &quot;1v1 定制学习内容&quot;">​</a></h3><p>根据你现有的专业技能，你的工作经验年限，以及你未来要面试的公司规模，统一考虑，制定你需要补充的技能。</p><p><strong>要让你的专业技能，符合你工作经验年限，也符合目标公司的要求</strong>。工作 2 年的和工作 8 年的，技能要求肯定不一样。小厂和大厂技能要求也不一样。</p><p>如果你想面试大厂，要补充<strong>算法</strong>。</p><p>如果你工作多年只会 Vue ，要恶补 <strong>React</strong> 技术栈，2 周即可从入门到熟练。</p><p>如果你想争取一份技术负责人的角色，你需要熟悉 <strong>Node 服务端</strong>，还有<strong>前端工程化</strong>。</p><p>如果你的项目规模比较大，需要考虑<strong>微前端</strong>方向。</p><p>想要争取到心仪的 offer 肯定需要进步、需要恶补，这个服务会告诉你方向，而且 <a href="https://www.mianshipai.com/" target="_blank" rel="noreferrer">面试派</a> 就有免费的内容。</p><p>学习过程中遇到问题怎么办？—— 好办，会有专属答疑服务，见下文。</p><h3 id="_1v1-模拟面试" tabindex="-1">1v1 模拟面试 <a class="header-anchor" href="#_1v1-模拟面试" aria-label="Permalink to &quot;1v1 模拟面试&quot;">​</a></h3><p>如果你不确定自己准备的如何，或者表达不流畅，或者面试紧张社恐，那最好来一次模拟面试，及早暴露问题。</p><p>会模拟真实的面试场景，包括：自我介绍，基础知识面试，框架，项目介绍和成就，场景题等...</p><p>如果你刚毕业不久，会更多考察基础知识、框架和编码能力。</p><p>如果你工作时间较长，会更多考察你的项目，设计和架构能力，以及场景解答能力。</p><p>如果你要面试中大厂，会更多考察算法和原理。</p><p>最后，面试官会给你详细的面试反馈和建议。</p><h3 id="全过程跟踪-专属答疑" tabindex="-1">全过程跟踪 &amp; 专属答疑 <a class="header-anchor" href="#全过程跟踪-专属答疑" aria-label="Permalink to &quot;全过程跟踪 &amp; 专属答疑&quot;">​</a></h3><p>两次 1v1 结束了，但我们的服务还会继续，全过程跟踪你的学习、投简历、面试、谈薪和 offer</p><p>在这个过程中，你有任何问题都可以提问，讲有专门的讲师为你答疑，给你提出最合理的简历。</p><p>例如学习过程中遇到了技术问题或者 bug ，投递简历已读不回，面试没通过，谈薪时是否应该多争取一点...</p><p>该服务会持续 3 个月时间，可以从头到尾覆盖你的面试完整流程。</p><h2 id="服务流程" tabindex="-1">服务流程 <a class="header-anchor" href="#服务流程" aria-label="Permalink to &quot;服务流程&quot;">​</a></h2><ul><li>报名，个人情况初步沟通（预约方式见下文）</li><li>第一次 1v1 语音私聊：简历优化 + 制定学习内容 <code>1.5h</code></li><li>第二次 1v1 语音私聊：模拟面试 <code>1h</code></li><li>专属答疑 <code>3 个月</code></li></ul><h2 id="价格" tabindex="-1">价格 <a class="header-anchor" href="#价格" aria-label="Permalink to &quot;价格&quot;">​</a></h2><p>1499 元</p><p>发微信群或朋友圈分享 <a href="https://www.mianshipai.com/" target="_blank" rel="noreferrer">前端面试派</a> 相关文章，可优惠 100 元 。</p><p>推荐其他人报名，可获得推荐费 100 元。</p><h2 id="报名方式" tabindex="-1">报名方式 <a class="header-anchor" href="#报名方式" aria-label="Permalink to &quot;报名方式&quot;">​</a></h2><p><a href="https://github.com/mianshipai/mianshipai-web/issues/1" target="_blank" rel="noreferrer">加群</a> 私聊群主 <code>双越</code> （或直接加 vx <code>fe-wfp</code>），报名<code>金牌简历计划</code></p><p>报名时先交 399 元定金，锁定预约的时间，待服务开始时再交尾款。</p><h2 id="注意事项" tabindex="-1">注意事项 <a class="header-anchor" href="#注意事项" aria-label="Permalink to &quot;注意事项&quot;">​</a></h2><h3 id="延期或取消" tabindex="-1">延期或取消 <a class="header-anchor" href="#延期或取消" aria-label="Permalink to &quot;延期或取消&quot;">​</a></h3><p>距离预约时间超过 24 小时</p><ul><li>修改咨询时间，免费。</li><li>取消，需扣除 100 元的定金作为违约金。</li></ul><p>距离预约时间 24 小时之内</p><ul><li>修改咨询时间，需扣除 100 元的定金作为违约金。</li><li>取消，需扣除 200 元的定金作为违约金。</li></ul><h3 id="迟到" tabindex="-1">迟到 <a class="header-anchor" href="#迟到" aria-label="Permalink to &quot;迟到&quot;">​</a></h3><p>迟到 5 分钟之内，可不扣费。</p><p>迟到 5 - 10 分钟，需扣除 50 元定金作为违约金。</p><p>迟到 10 - 20 分钟，需扣除 100 元定金作为违约金。</p><p>迟到 20 - 30 分钟，需扣除 150 元定金作为违约金。</p><p>迟到超过 30 分钟，则视为取消本地 1v1 服务。</p>',72)]))}const _=e(n,[["render",h]]);export{g as __pageData,_ as default};
